; #########################################################################
;
;   game.asm - Assembly file for EECS205 Assignment 4/5
;
;	Katherine Steiner
;
; #########################################################################

; #########################################################################
;
; INSTRUCTIONS
; 
; press B to begin. collect the blue butterflies, avoid the orange.
; collect the yellow butterfly to move faster.
; press space to pause and any key to unpause.
; use arrow keys to move
; there are two levels, the second has more blue butterflies than the first.
;
; ADVANCED FEATURES
;
; scrolling background - on change between levels
; gravity or other forces - butterflies move with nonconstant velocity due
;	to random accelerations
; powerups - yellow butterfly makes player move faster
;
;
; IMPLEMENTATION NOTES
; 
; there are 6 SCREEN_LEVELS. game starts at SCREEN_LEVEL = 1
; (1) instructions screen
; (2) level 1, with 1 morpho butterfly. collect to finish level
; (3) transition between level 1 and 2, background scrolls
; (4) level 2, with 3 morpho butterflies. collect all to finish level
; (5) game over screen, for if player touches orange butterfly
; (6) win game screen, for if player successfully completes level 2
;
; #########################################################################

      .586
      .MODEL FLAT,STDCALL
      .STACK 4096
      option casemap :none  ; case sensitive

include stars.inc
include lines.inc
include trig.inc
include blit.inc
include game.inc

include \masm32\include\masm32.inc

includelib \masm32\lib\masm32.lib


;; Has keycodes
include keys.inc

	
