;; Note: You will need to implement CheckIntersect!!!

IntersectWrapper PROC USES ebx ecx one:PTR SPRITE, two:PTR SPRITE
	mov ebx, one
	mov ecx, two
	invoke CheckIntersect, (SPRITE PTR [ebx]).x, (SPRITE PTR [ebx]).y, (SPRITE PTR [ebx]).obj, (SPRITE PTR [ecx]).x, (SPRITE PTR [ecx]).y, (SPRITE PTR [ecx]).obj
	cmp eax, 0
	je no_intersect
	mov (SPRITE PTR [ecx]).active, 0
no_intersect:
	ret
IntersectWrapper ENDP

CheckIntersect PROC USES ebx ecx edi esi oneX:DWORD, oneY:DWORD, oneBitmap:PTR EECS205BITMAP, twoX:DWORD, twoY:DWORD, twoBitmap:PTR EECS205BITMAP
	; compute one's right and left bounds
	; computer two's right and left bounds
	; if one's left > two's right, no intersect
	; if two's left > one's right, no intersect
	mov ebx, oneBitmap
	mov ebx, (EECS205BITMAP PTR [ebx]).dwWidth
	sar ebx, 1
	mov ecx, oneX
	sub ecx, ebx  ; ecx <- oneX - width/2, one's left
	add ebx, oneX ; ebx <- oneX + width/2, one's right

	mov edi, twoBitmap
	mov edi, (EECS205BITMAP PTR [edi]).dwWidth
	sar edi, 1
	mov esi, twoX
	sub esi, edi  ; esi <- twoX - width/2, two's left
	add edi, twoX ; edi <- twoX + width/2, two's right

	cmp ecx, edi ; one's left, two's right
	jg no_intersect
	cmp esi, ebx ; two's left, one's right
	jg no_intersect

	; compute one's top and bottom
	; compute two's top and bottom
	; if one's top < two's bottom, no intersect
	; if two's top < one's bottom, no intersect
	mov ebx, oneBitmap
	mov ebx, (EECS205BITMAP PTR [ebx]).dwHeight
	sar ebx, 1
	mov ecx, oneY
	sub ecx, ebx  ; ecx <- oneY - height/2, one's bottom
	add ebx, oneY ; ebx <- oneY + height/2, one's top

	mov edi, twoBitmap
	mov edi, (EECS205BITMAP PTR [edi]).dwHeight
	sar edi, 1
	mov esi, twoY
	sub esi, edi  ; esi <- twoY - height/2, two's bottom
	add edi, twoY ; edi <- twoY + height/2, two's top

	cmp ebx, esi ; one's top, two's bottom
	jl no_intersect
	cmp edi, ecx ; two's top, one's bottom
	jl no_intersect
	
	; if none of those, they must be intersecting
	mov eax, 1
	ret
	
no_intersect:
	mov eax, 0
	ret
okay:
	ret
CheckIntersect ENDP

FillScreenColor PROC USES ebx ecx color:BYTE
	xor ebx, ebx
	jmp x_cond
x_body:
	; here begins x body
	xor ecx, ecx
	jmp y_cond
y_body:
	; here begins y body
	invoke DrawPixel, ebx, ecx, color
	inc ecx
	; here ends y body
y_cond:
	cmp ecx, 480
	jl y_body
	inc ebx
	; here ends x body
x_cond:
	cmp ebx, 640
	jl x_body
	ret
FillScreenColor ENDP

CheckAnyActive PROC USES ecx
	; returns 0 if ALL morphos are collected, 1 if any are active
	xor eax, eax
	mov ecx, offset STAR
	mov ecx, (SPRITE PTR [ecx]).active
	or eax, ecx
	mov ecx, offset STAR2
	mov ecx, (SPRITE PTR [ecx]).active
	or eax, ecx
	mov ecx, offset STAR3
	mov ecx, (SPRITE PTR [ecx]).active
	or eax, ecx
	ret
CheckAnyActive ENDP

MoveByClick PROC USES esi ecx ebx edx ship:PTR SPRITE
	mov esi, ship
	; invoke RotateBlit, (SPRITE PTR [esi]).obj, (SPRITE PTR [esi]).x, (SPRITE PTR [esi]).y, (SPRITE PTR [esi]).theta
	add (SPRITE PTR [esi]).theta, 800h
	mov ecx, MouseStatus.buttons
	cmp ecx, MK_LBUTTON
	jne no_move
	mov ebx, MouseStatus.horiz
	mov (SPRITE PTR [esi]).x, ebx
	mov edx, MouseStatus.vert
	mov (SPRITE PTR [esi]).y, edx
no_move:
	invoke RotateBlit, (SPRITE PTR [esi]).obj, (SPRITE PTR [esi]).x, (SPRITE PTR [esi]).y, (SPRITE PTR [esi]).theta
	ret
MoveByClick ENDP

MoveStars PROC USES esi ebx edx nova:PTR SPRITE
	; butterflies move with random acceleration
	; thus have nonconstant velocities
	; butterflies stay on screen (cannot go off screen)
	mov esi, nova
	cmp (SPRITE PTR [esi]).active, 1
	je still_active
	ret

still_active:
	add (SPRITE PTR [esi]).theta, 800h

	mov ebx, (SPRITE PTR [esi]).x		; ebx <- x
	invoke nrandom, 20
	sub eax, 10				; eax <- rand from -5 to 5
	add (SPRITE PTR [esi]).vx, eax
	add ebx, (SPRITE PTR [esi]).vx
	sar eax, 1
	add ebx, eax
	cmp ebx, 0
	jg x_not_neg
	mov ebx, 0
	mov (SPRITE PTR [esi]).vx, 1
x_not_neg:
	cmp ebx, 640
	jl x_okay_to_move
	mov ebx, 639
	mov (SPRITE PTR [esi]).vx, -1
x_okay_to_move:
	mov (SPRITE PTR [esi]).x, ebx		; update x

	mov edx, (SPRITE PTR [esi]).y
	invoke nrandom, 20
	sub eax, 10
	add (SPRITE PTR [esi]).vy, eax
	add edx, (SPRITE PTR [esi]).vy
	sar eax, 1
	add edx, eax
	cmp edx, 0
	jg y_not_neg
	mov edx, 0
	mov (SPRITE PTR [esi]).vy, 10
y_not_neg:
	cmp edx, 480
	jl y_okay_to_move
	mov edx, 439
	mov (SPRITE PTR [esi]).vy, -1
y_okay_to_move:
	mov (SPRITE PTR [esi]).y, edx

	invoke RotateBlit, (SPRITE PTR [esi]).obj, (SPRITE PTR [esi]).x, (SPRITE PTR [esi]).y, (SPRITE PTR [esi]).theta
	ret 
MoveStars ENDP

MoveByArrows PROC USES ebx ecx edx esi edi qqc:PTR SPRITE
	mov esi, BUCKET_SPEED
	mov ecx, qqc
	mov ebx, KeyPress
	cmp ebx, VK_UP
	jne go_right
	sub (SPRITE PTR [ecx]).y, esi
	jmp check_on_screen
go_right:
	cmp ebx, VK_RIGHT
	jne go_down
	add (SPRITE PTR [ecx]).x, esi
	jmp check_on_screen
go_down:
	cmp ebx, VK_DOWN
	jne go_left
	add (SPRITE PTR [ecx]).y, esi
	jmp check_on_screen
go_left:
	cmp ebx, VK_LEFT
	jne no_move
	sub (SPRITE PTR [ecx]).x, esi
	jmp check_on_screen
check_on_screen:
	cmp (SPRITE PTR [ecx]).y, 0
	jge L1
	mov (SPRITE PTR [ecx]).y, 0
L1:
	cmp (SPRITE PTR [ecx]).y, 480
	jl L2
	mov (SPRITE PTR [ecx]).y, 479
L2:
	cmp (SPRITE PTR [ecx]).x, 0
	jge L3
	mov (SPRITE PTR [ecx]).x, 0
L3:
	cmp (SPRITE PTR [ecx]).x, 640
	jl L4
	mov (SPRITE PTR [ecx]).x, 639
L4:
no_move:
	ret
MoveByArrows ENDP

CheckPause PROC USES ecx
	mov eax, 0
	mov ecx, KeyDown
	cmp ecx, VK_SPACE
	jne okay
	mov eax, 1
okay:
	ret
CheckPause ENDP

CheckBegin PROC USES ecx
	mov eax, 0
	mov ecx, KeyPress
	cmp ecx, VK_B
	jne okay
	mov eax, 1
okay:
	ret
CheckBegin ENDP

LevelOne PROC USES ecx ebx edx edi esi
	; only 1 morpho butterfly to catch
	; render the background
	mov ecx, offset HELEN
	invoke RotateBlit, (SPRITE PTR [ecx]).obj, (SPRITE PTR [ecx]).x, (SPRITE PTR [ecx]).y, (SPRITE PTR [ecx]).theta
	
	; move the bucket
	mov ecx, offset BUCKET
	invoke MoveByArrows, offset BUCKET
	invoke RotateBlit, (SPRITE PTR [ecx]).obj, (SPRITE PTR [ecx]).x, (SPRITE PTR [ecx]).y, (SPRITE PTR [ecx]).theta

	; move the butterflies	
	invoke MoveStars, offset STAR
	invoke MoveStars, offset YELLOW
	invoke MoveStars, offset MONARCH

	; check for collisions
	invoke IntersectWrapper, offset BUCKET, offset MONARCH
	cmp eax, 0
	je no_monarch_intersect
	mov SCREEN_LEVEL, 5
no_monarch_intersect:
	invoke IntersectWrapper, offset BUCKET, offset YELLOW
	cmp eax, 0
	je no_yellow_intersect
	mov BUCKET_SPEED, 7
no_yellow_intersect:
	invoke IntersectWrapper, offset BUCKET, offset STAR
	cmp eax, 0
	je no_intersections
	inc SCREEN_LEVEL
no_intersections:
okay:
	ret         ;; Do not delete this line!!!
LevelOne ENDP

ResetGame PROC USES ecx
	; reset stuff after completing level 1
	; note if you ate the yellow in 1, it won't reappear in 2.
	mov ecx, offset HELEN
	mov (SPRITE PTR [ecx]).x, 320
	mov SCREEN_LEVEL, 4
	mov ecx, offset HELEN2
	mov (SPRITE PTR [ecx]).x, 960

	mov ecx, offset STAR
	mov (SPRITE PTR [ecx]).active, 1
	; mov ecx, offset YELLOW
	; mov (SPRITE PTR [ecx]).active, 1
	mov ecx, offset MONARCH
	mov (SPRITE PTR [ecx]).active, 1

	mov ecx, offset BUCKET
	mov (SPRITE PTR [ecx]).x, 320
	mov (SPRITE PTR [ecx]).y, 320
	ret
ResetGame ENDP

GameInit PROC USES ecx
	rdtsc
	invoke nseed, eax
	ret         ;; Do not delete this line!!!
GameInit ENDP

GamePlay PROC USES ecx ebx edx edi esi

	; check if paused
	invoke CheckPause
	cmp eax, 0
	jne okay

	; Instuctions (1)
	; fill screen with a color and render all instruction strings
	cmp SCREEN_LEVEL, 1
	jne not_instructions_screen
	invoke FillScreenColor, 0
	invoke DrawStr, offset Instruct1, 200, 190, 0ffh
	invoke DrawStr, offset Instruct2, 200, 240, 0ffh
	invoke DrawStr, offset Instruct3, 200, 290, 0ffh
	invoke DrawStr, offset Instruct4, 200, 340, 0ffh
	invoke DrawStr, offset Instruct5, 200, 390, 0ffh
	; if player presses B, start level 1 with SCREEN_LEVEL 2
	invoke CheckBegin
	cmp eax, 1
	jne dont_begin
	mov SCREEN_LEVEL, 2
dont_begin:
	ret
not_instructions_screen:
	cmp SCREEN_LEVEL, 2
	jne not_screen_two
	invoke LevelOne
	ret
not_screen_two:
	cmp SCREEN_LEVEL, 3
	jne not_three
	; moving from first level to second level (scrolling)
	mov ecx, offset HELEN
	sub (SPRITE PTR [ecx]).x, 10
	invoke RotateBlit, (SPRITE PTR [ecx]).obj, (SPRITE PTR [ecx]).x, (SPRITE PTR [ecx]).y, (SPRITE PTR [ecx]).theta
	mov ecx, offset HELEN2
	sub (SPRITE PTR [ecx]).x, 10
	invoke RotateBlit, (SPRITE PTR [ecx]).obj, (SPRITE PTR [ecx]).x, (SPRITE PTR [ecx]).y, (SPRITE PTR [ecx]).theta
	cmp (SPRITE PTR [ecx]).x, 320
	jg okay
	invoke ResetGame ; once done scrolling, reset for level 2 (screen level 4)
	ret
not_three:
	cmp SCREEN_LEVEL, 4
	jne not_four
	; this is level (2) which is (1) but with more morphos

	; background
	mov ecx, offset HELEN
	invoke RotateBlit, (SPRITE PTR [ecx]).obj, (SPRITE PTR [ecx]).x, (SPRITE PTR [ecx]).y, (SPRITE PTR [ecx]).theta
	
	; move the bucket
	mov ecx, offset BUCKET
	invoke MoveByArrows, offset BUCKET
	invoke RotateBlit, (SPRITE PTR [ecx]).obj, (SPRITE PTR [ecx]).x, (SPRITE PTR [ecx]).y, (SPRITE PTR [ecx]).theta
	
	; move the butterflies
	invoke MoveStars, offset STAR
	invoke MoveStars, offset STAR2
	invoke MoveStars, offset STAR3
	invoke MoveStars, offset YELLOW
	invoke MoveStars, offset MONARCH

	; check for collisions
	invoke IntersectWrapper, offset BUCKET, offset MONARCH
	cmp eax, 0
	je four_no_monarch
	mov SCREEN_LEVEL, 5
four_no_monarch:
	invoke IntersectWrapper, offset BUCKET, offset YELLOW
	cmp eax, 0
	je four_no_yellow
	mov BUCKET_SPEED, 7
four_no_yellow:
	invoke IntersectWrapper, offset BUCKET, offset STAR
	invoke IntersectWrapper, offset BUCKET, offset STAR2
	invoke IntersectWrapper, offset BUCKET, offset STAR3
	invoke CheckAnyActive ; returns 0 if ALL morphos are collected, 1 if any are active
	cmp eax, 0
	jne still_on_four
	mov SCREEN_LEVEL, 6
still_on_four:
	ret
not_four: 	; this is the game over screen
	cmp SCREEN_LEVEL, 5
	jne not_five
	invoke FillScreenColor, 0aah
	invoke DrawStr, offset GameOverStr, 200, 200, 0h
	ret
not_five:	; this is the you won screen
	cmp SCREEN_LEVEL, 6
	jne okay
	invoke FillScreenColor, 0aah
	invoke DrawStr, offset YouWinStr, 100, 200, 0ffh
okay:
	ret
GamePlay ENDP

